def list_cameras():
    for camera in cameras["features"]:
        cam = camera["properties"]
        gcam = camera["geometry"]["coordinates"]
        yield {"description": cam["name"], "geo": {"lat": gcam[0], "lon": gcam[1]}, "id": cam["id"], "format": cam["hls_stream_protected"].replace("\\","")}